    state={
        form:{
            "nom_com":"",
            "id_rgn":""
        },
        error:false,
        errorMsg:""
    }

    manejadorSubmit(e){
        e.preventDefault();
    }
    
    manejadorChange = async e=>{
        await  this.setState({
            form:{
                ...this.state.form,
                [e.target.name]: e.target.value
            }
        })
        console.log(this.state.form);
    }

    manejadorBoton=()=>{
        let url = Apiurl + "auth";
        axios.post(url,this.state.form)
        .then(response =>{
            console.log(response);
        });
    };

